Het Haagse Gerechtshof is ook de instantie voor zaken, naast de gebruikelijke rechtsgebieden voor enkele speciale rechtsgebieden:  


tegen de Staat (in hoger beroep);


op het gebied van intellectueel eigendom   
Mevr. Mr. J.C. Fasseur - van Santen- Concentratie, specialisatie en intellectuele eigendom in TREMA december  2004- Special, Wettelijke concentratie van rechtspraak. , waaronder het kwekersrecht (c.q. Zaaizaad en Plantgoedwet);


tegen besluiten van het Schadefonds Geweldsmisdrijven (in hoger beroep);


betreffende  klachten tegen beslissingen van Officieren van Justitie om een bepaald strafbaar feit niet te vervolgen.

De kolommen waren als volgt verdeeld voor notitie van:  


Rolnummer; 


De namen van de appellant en geïntimeerde;


Namen van de procureurs ;


Afloop van de behandeling van het onderzoek ter terechtzitting (bijvoorbeeld arrest, interlocutoir (=tussen) arrest, royement, beraad, verwijzing, aanhouding (= uitstel van de behandeling of eindbeslissing) etc.;


Griffierecht.

Bij besluit van de Minister van Justitie van 11 oktober 1979 werd een commissie ingesteld die tot taak kreeg de Minister van advies te dienen aangaande: 


de mogelijkheden tot vereenvoudiging respectievelijk verbetering van de werkwijze van de belastingkamers;


een eventuele wijziging van de normen, zoals die ontwikkeld waren door Mr. L. Hollander, welke commissie rapport heeft uitgebracht in 1971 betreffende de bezetting van de belastingkamers.

Deze wetwijzingen    
De kwaliteit en efficiency van de belastingrechtspraak door Prof. Mr. C.H.J. Langereis in Nederlands juristenblad (NJB) december 1987  pg. 1482 - 1487 en  de Wet van 13 januari 1983, houdende wijziging van de Wet administratieve  rechtspraak belastingzaken (Staatsblad nummer 60).  behelsden o.a.: 


de invoering van het griffierecht;


de mogelijkheid van een mondelinge uitspraak, waarbij met het WORDPLEX systeem op één bladzijde een proces-verbaal wordt opgemaakt c.q. ingevuld. Dit gebeurde op grond van art. 17a van de Wet ARB;


de mogelijkheid van een voorzittersbeschikking, waarbij o.m. kennelijke niet - ontvankelijke (niet vatbaar voor berechting) en kennelijke (on)gegronde beroepen op de uitspraken van de belastinginspecteur kunnen worden afgedaan. Dit was mogelijk op grond van artikel 18a Wet ARB, zonder dat er stukken werden gewisseld of een mondelinge behandeling plaatsvond. De enkelvoudige kamers doen in deze 80-89 periode twee maal zoveel mondelinge als schriftelijke uitspraken;


de instelling van een zogenaamde Raadsheercommissaris om getuigen te horen;


- de mogelijkheid van sneller doen van een uitspraak door de belastingrechter door af te zien  van een mondelinge behandeling, omdat de zaak door de uitwisseling van stukken kan de belastingrechter krachtens artikel 11a Wet ARB voldoende is voorbereid;


dat een enkelvoudige belastingkamer verwijziging naar een meervoudige kamer kan weigeren.

Vereisten voor het vervullen van deze functies zijn:  


het Nederlanderschap;


een leeftijd van tenminste vijfentwintig jaar, maar nog niet de leeftijd van zeventig jaar hebben bereikt;


een doctoraat in de rechtswetenschappen of een meestertitel.
